import React from 'react';
import { Link } from 'react-router-dom'; // or use <a href="/" if not using react-router
import logo from '../assets/logo.png'; // Make sure to move your logo to src/assets

const Navbar = () => {
  return (
    <nav className="flex items-center justify-between px-6 py-4 bg-white shadow">
      <Link to="/">
        <img src={logo} alt="Stray Paws Logo" className="h-10 w-auto cursor-pointer" />
      </Link>
      <div className="space-x-6">
        <a href="#teams" className="text-gray-800 hover:text-blue-500">Teams</a>
        <a href="#rescues" className="text-gray-800 hover:text-blue-500">Rescues</a>
        <a href="#products" className="text-gray-800 hover:text-blue-500">Products</a>
        <a href="#analytics" className="text-gray-800 hover:text-blue-500">Analytics</a>
        <a href="#register" className="text-blue-600 font-semibold">Register</a>
      </div>
    </nav>
  );
};

export default Navbar;
